const {
  POST_SUCCESS,
  POST_FAIL,
  GET_SUCCESS,
  GET_FAIL,
  USER_AUTH_SUCCESS,
  USER_AUTH_FAIL,
} = require("../constants/exampleConstants.js");

function postExampleReducer(state = {}, action) {
  switch (action.type) {
    case POST_SUCCESS:
      console.log("post reducer", action.payload)
      return { loading: false, content: action.payload };
    case POST_FAIL:
      return { loading: false, error: action.payload };
    default:
      return state;
  }
}

function getExampleReducer(state = {}, action) {
  switch (action.type) {
    case GET_SUCCESS:
      console.log("get reducer", action.payload)
      return { loading: false, userInfo: action.payload };
    case GET_FAIL:
      return { loading: false, error: action.payload };
    default:
      return state;
  }
}
function putExampleReducer(state = { userInfo: {} }, action) {
  switch (action.type) {
    case USER_AUTH_SUCCESS:
      return { loading: false, userInfo: action.payload };
    case USER_AUTH_FAIL:
      return { loading: false, error: action.payload };
    default:
      return state;
  }
}
function deleteExampleReducer(state = { userInfo: {} }, action) {
  switch (action.type) {
    case USER_AUTH_SUCCESS:
      return { loading: false, userInfo: action.payload };
    case USER_AUTH_FAIL:
      return { loading: false, error: action.payload };
    default:
      return state;
  }
}
export {
  postExampleReducer,
  getExampleReducer,
  putExampleReducer,
  deleteExampleReducer,
};
